import React from 'react';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import '../styles/MenuAppBar.css';
import LogoImage from '../assets/logo.jpeg';
import OtherHousesOutlinedIcon from '@mui/icons-material/OtherHousesOutlined';
import LocationIcon from '@mui/icons-material/LocationOn';
import axios from 'axios';

function MenuAppBar() {
  const navigate = useNavigate();

  const navigateToLocation = async () => {
    try {
      const email = sessionStorage.getItem('email'); // sessionStorage'den email bilgisini al
      const response = await axios.get(`http://localhost:8081/api/posts/getPostsAroundUser/${sessionStorage.getItem("userEmail")}`);
      const locations = response.data; // API'den gelen veriyi locations olarak al
      console.log("response",response)
      navigate('/locations', { state: { locations } }); // locations.js sayfasına yönlendirme yap ve veriyi props olarak gönder
    } catch (error) {
      console.error('Error fetching locations:', error);
    }
  };

  return (
    <div>
      <div className='navbar'>
        <div className="img-navbarLogo" style={{ backgroundImage: `url(${LogoImage})`, width: '50px' }}></div>
        <button style={{ backgroundColor: 'white', cursor: 'pointer', border: 'none', height: '7vmin' }}>
          <OtherHousesOutlinedIcon />
        </button>
        <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }} onClick={navigateToLocation}>
          <LocationIcon />
        </button>
        <div>
          <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }}>
            <MenuIcon />
          </button>
        </div>
      </div>
    </div>
  );
}

export default MenuAppBar;
